    false,nt"url": null,nt"notes": "Estimates of acreages of upland, wetland,
    and permanent water habitat important to migrating and wintering waterfowl were
    made for each of 164 management units in the United States. One estimate was made
    for 1965 and another for the year 2000. These estimates are needed as a basis for
    determining the adequacy of habitat to meet the requirements of waterfowl in the
